import React from "react";
import Card from "../Components/Card";

const card = ({data}) => {
    const Favs = () => {
        const favs = JSON.parse(localStorage.getItem("favs"));

        return (
            <>
                {favs.map(Doct => (
                    <div>
                        <h1>Dentists Favs</h1>
                        <img className='imgdoctor' src="../../public/images/doctor.jpg" alt="" />
                        <h3>{data.name}</h3>
                        <h4>{data.username}</h4>
                        <p>{data.ip}</p>
                    </div>
                ))}

            </>

        );
    };
}

export default card;
